<p id=""aboutme"">
    C# (illetve Java SE) magántanítást vállalok alapoktól vagy korrepetálásként.<br>
    <br>
    Ha szeretnél elkezdeni programozni és nem találod a stabil pontot amihez fogj,
    akkor át tudom adni amire szükséged van, mind a gyakorlati tudást, mind pedig azt az absztrakt,
    nyelvektől független elméletet, programozói gondolkodást amihez a programozók eljutnak az évek során.
    Ekkor rájössz rájössz, hogy ez fontosabb mint maga a nyelv kiválasztása,
    hiszen ezek a nyelvek ugyanazon paradigmákat implementájlák a saját módjukon, kisebb variációkkal.<br>
    <br>
    Ezért az alapokat, az Objektum Orientáció, Funkcionális programozás, illetve e két paradigma őseit jelentő Strukturált, Procedurális, Imperatív programozás alapjait szinte akármelyik nyelven keresztül be tudom mutatni amellyel már volt dolgom, legyen az C#, Java, Swift, C++.<br>
    <br>
    Természetesen ezen alapokon túl is rengeteg minden van még,
    hiszen ezek a paradigmák csak eszközök arra hogy elérhessük az egyre ");
            WriteLiteral(@"összetettebb megoldásokat igénylő céljainkat,
    amik megkövetelik azt hogy átláthatóbb, szervezettebb, könnyen fejleszthető, úgymond ""scalable"" forráskódot írjunk.<br>
    <br>
    Ezért is örülök neki, hogy be tudom mutatni a fontos ismereteket a saját projektjeimen keresztül: regular expressions, fájlkezelés, egy kevés hálózati kérelmekből, multithreading,
    adatszerkezetek felépítése belülről, alapvetőbb algoritmusok, grafikus felületek.<br>
    <br>
    Projektjeim készítése alatt végül is a C# nyelv amit kiismertem lexikálisan, legtöbb speciális vonásaival,
    egyediségeivel együtt, és tudom hova nyúljak ha kell valami. Java-val is sokat foglalkoztam, nem annyit,
    de sok projektemet ezzel készítettem, ezért abban is tudok segítséget nyújtani.<br>
    <br>
    6 éve programozom.<br>
